import React from "react";
import { connect } from "react-redux";
import { btnPlay } from "../actions";
import "./Buttons.css";

const ButtonPlay = ({ icon, onClickArg, btnPlay }) => {
  return (
    <button className="btn btn-play" onClick={() => btnPlay(onClickArg)}>
      <ion-icon name={icon} />
    </button>
  );
};

const mapDispatchToProps = () => {
  return { btnPlay };
};

export default connect(
  null,
  mapDispatchToProps
)(ButtonPlay);
